import React from "react";
import Link from "next/link";

const MobileHeader = (props) => {
  return props.loggedIn ? (
    <>
      <div id="screen">
        <input type="checkbox" id="show" />
        <ul class="side_nav">
          <li>
            <a href="#">
              <b>Home</b>
            </a>
          </li>
          <li>
            <a href="#">
              <b>Contact</b>
            </a>
          </li>
          <li>
            <a href="#">
              <b>About us</b>
            </a>
          </li>
          <li>
            <a href="#">
              <b>Portfolio</b>
            </a>
          </li>
        </ul>
        <section>
          <label for="show">menu</label>
        </section>
      </div>
      <style jsx>{`
        @import url(https://fonts.googleapis.com/css?family=Fredoka + One);

        * {
          box-sizing: border-box;
        }
        body {
          background: #dcdcdc;
        }
        #screen {
          background: #222;
          box-shadow: 0 0 5em #222;
          margin-bottom: 5px;
          margin: 2% 40%;
          position: relative;
        }
        #show {
          display: none;
        }
        section {
          max-width: 350px;
          width: 350px;
          height: 500px;
          background: #222
            url("https://luisendara.files.wordpress.com/2012/11/screen-shot-2012-11-28-at-11-22-48.png")
            no-repeat center;
          background-size: cover;
          position: relative;
          transition: 0.4s;
        }

        section label {
          text-transform: uppercase;
          color: #fff;
          font-size: 1em;
          font-weight: bold;
          background: none;
          position: absolute;
          top: 10%;
          left: 35%;
          padding: 10px 20px;
          cursor: pointer;
          transition: 0.2s;
          border: 1px solid #fff;
        }

        section label:hover {
          background: #fff;
          color: #222;
        }
        li {
          list-style: none;
        }
        a {
          text-decoration: none;
          color: #222;
          font-weight: bolder;
        }

        .side_nav {
          position: absolute;
          background: #222;
          font-family: "Fredoka One", cursive;
          width: 250px;
          padding: 0px;
          height: auto;
          top: 0;
          bottom: 0;
          left: 0;
          padding-top: 75px;
          overflow: hidden;
        }
        .side_nav li {
          text-align: center;
          margin-bottom: 10px;
          margin-left: 0px;
          transition: 0.4s;
        }
        .side_nav li :hover {
          background: #fff;
          color: #222;
        }
        .side_nav li a {
          display: block;
          padding: 10px 0;
          font-weight: 100;
          color: #fff;
        }
        #show:checked ~ section {
          transform: translateX(250px);
        }

        @media (max-width: 720px) {
          .mobile {
            display: block;
          }
        }
      `}</style>
    </>
  ) : (
    <div className="header flex">
      <div className="header-item">Logo ass</div>
    </div>
  );
};

export default MobileHeader;
